import React from "react";
import { HStack, Box } from "@chakra-ui/react";

import Sidebar from "./Sidebar";

function Dashboard({}) {
  return (
    <div className="dashboard">
      <HStack>
        <Sidebar />
        <Box bg="tomato" w="80vw" h="110vh"></Box>
      </HStack>
    </div>
  );
}

export default Dashboard;
